    true,nt"url": null,nt"notes": "Conceptual model for the Newberry Caldera
    geothermal area. Model is centered around caldera and evaluates multiple geophysical
    datasets to derive a conceptual subsurface model. nnIncludes:nn--Conductor layer
    based on transient electromagnetic data from Fitterman et al., 1988 (figure 10)n--Base
    of conductor layer based on MT conductor values found in Waibel et al., 2014 (DOE
    document, figure 38)n--Resistor layer based on magnetotellurics from Fitterman et
    al., 1988 (figure 13). n--Seismic intrusives layer representing a smoothed version
    of 5.5 km/s seismic velocity layer defined in Beachly et al., 2012 n--West flank
    seismic body representing a fractional change in seismic velocity of 0.1, defined
    in Beachly et al., 2012 and Heath et al., 2015 n--West flank gravity body "granite"
    that represents a gravity anomaly identified in Waibel et al., 2014 (DOE document,
    figure 35)n--Magma chamber defined seismically, found in Heath et al., 2015 n--Ring
    fracture fault intrusionsn--Various faults and geologic layers ",nt"license_title":
